import React, { useState, useEffect } from 'react';

const Navbar = () => {
  const [scrolled, setScrolled] = useState(false);
  const [mobileMenuOpen, setMobileMenuOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      setScrolled(window.scrollY > 10);
    };

    window.addEventListener('scroll', handleScroll);
    return () => window.removeEventListener('scroll', handleScroll);
  }, []);

  const toggleMobileMenu = () => {
    const nextState = !mobileMenuOpen;
    setMobileMenuOpen(nextState);
    document.body.style.overflow = nextState ? 'hidden' : 'auto';
  };

  const closeMobileMenu = () => {
    setMobileMenuOpen(false);
    document.body.style.overflow = 'auto';
  };

  return (
    <nav
      className={
        `fixed w-full z-50 transition-all duration-500 backdrop-blur-md ` +
        (scrolled
          ? 'bg-[#0B1F3A]/90 shadow-xl py-2'
          : 'bg-transparent py-4')
      }
    >
      <div className="container mx-auto px-4 sm:px-6 lg:px-8 flex justify-between items-center">
        <div className="flex items-center">
          <span className="text-2xl sm:text-3xl font-bold bg-clip-text text-transparent bg-gradient-to-r from-[#1FB8D2] to-white">
            NovusWave
          </span>
          <span className="ml-2 text-[#1FB8D2] text-xs sm:text-sm hidden md:block">
            Surfing the Digital Future
          </span>
        </div>

        <div className="hidden lg:flex space-x-8">
          {['home', 'about', 'services', 'portfolio', 'contact'].map((section) => (
            <a
              key={section}
              href={`#${section}`}
              className="text-white hover:text-[#1FB8D2] transition-colors font-medium relative group"
            >
              <span className="capitalize sm:text-base text-sm">{
                section.replace('-', ' ')
              }</span>
              <span className="absolute bottom-0 left-0 w-0 h-0.5 bg-[#1FB8D2] transition-all duration-300 group-hover:w-full" />
            </a>
          ))}
        </div>

        <button
          className="lg:hidden text-white focus:outline-none z-50"
          onClick={toggleMobileMenu}
          aria-label="Toggle menu"
        >
          {mobileMenuOpen ? (
            <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M6 18L18 6M6 6l12 12" />
            </svg>
          ) : (
            <svg className="w-8 h-8" fill="none" stroke="currentColor" viewBox="0 0 24 24">
              <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M4 6h16M4 12h16M4 18h16" />
            </svg>
          )}
        </button>
      </div>

      {/* Mobile Slide-in Menu */}
      <div
        className={`lg:hidden fixed inset-0 bg-[#0B1F3A]/95 backdrop-blur-lg z-40 transform transition-transform duration-500 ease-in-out ` +
        (mobileMenuOpen ? 'translate-x-0' : 'translate-x-full')
        }
      >
        <div className="container mx-auto px-4 sm:px-6 pt-24 h-full flex flex-col justify-between">
          <div className="flex flex-col space-y-6 text-center flex-grow">
            {['Inicio','Sobre Nosotros','Servicios','Portafolio','Contacto'].map((label, idx) => (
              <a
                key={idx}
                href={`#${label.toLowerCase().replace(/\s+/g, '')}`}
                className="text-2xl sm:text-3xl text-white hover:text-[#1FB8D2] transition-colors py-2"
                onClick={closeMobileMenu}
              >
                {label}
              </a>
            ))}
          </div>
          <div className="pb-8 flex justify-center space-x-6">
            {/* Social Icons... */}
            <a href="#" className="text-white hover:text-[#1FB8D2] transition-colors" onClick={closeMobileMenu}>
              {/* Facebook Icon */}
              <svg className="w-6 h-6 sm:w-8 sm:h-8" fill="currentColor" viewBox="0 0 24 24">
                <path d="M22 12c0-5.523-4.477-10-10-10S2 6.477 2 12c0 4.991 3.657 9.128 8.438 9.878v-6.987h-2.54V12h2.54V9.797c0-2.506 1.492-3.89 3.777-3.89 1.094 0 2.238.195 2.238.195v2.46h-1.26c-1.243 0-1.63.771-1.63 1.562V12h2.773l-.443 2.89h-2.33v6.988C18.343 21.128 22 16.991 22 12z" />
              </svg>
            </a>
            {/* Instagram Icon */}
            <a href="#" className="text-white hover:text-[#1FB8D2] transition-colors" onClick={closeMobileMenu}>
              <svg className="w-6 h-6 sm:w-8 sm:h-8" fill="currentColor" viewBox="0 0 24 24">
                <path d="M12.315 2c2.43 0 2.784.013 3.808.06 ... (shortened for brevity)" />
              </svg>
            </a>
            {/* Twitter Icon */}
            <a href="#" className="text-white hover:text-[#1FB8D2] transition-colors" onClick={closeMobileMenu}>
              <svg className="w-6 h-6 sm:w-8 sm:h-8" fill="currentColor" viewBox="0 0 24 24">
                <path d="M8.29 20.251c7.547 0 11.675-6.253 ... (shortened)" />
              </svg>
            </a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
